import React, {Fragment, useEffect} from 'react';
import { firebase, auth } from '../firebase/firebase.config';
import { Redirect } from "react-router-dom";
import { CKEditor } from '@ckeditor/ckeditor5-react';
import ClassicEditor from '@ckeditor/ckeditor5-build-classic';
import TextField from '@material-ui/core/TextField';
import {Editor, EditorState} from 'draft-js';

function Admin() {
    const [editorState, setEditorState] = React.useState(
        () => EditorState.createEmpty(),
      );

    return (
        <div className="admin-news">
            <div className="post-form">
                <form action="" className="add-post">
                    <TextField id="title" label="სათაური" variant="filled" style={{width: "300px"}}/>
                    <br />
                    <br />
                    <TextField id="photo" label="ფოტოს ლინკი" variant="filled" style={{width: "300px"}}/>
                    <br />
                    <br />
                    <CKEditor
                            editor={ ClassicEditor }
                            onReady={ editor => {
                                console.log( 'Editor is ready to use!', editor );
                            } }
                            onChange={ ( event, editor ) => {
                                const data = editor.getData();
                                console.log( { event, editor, data } );
                            } }
                            onBlur={ ( event, editor ) => {
                                console.log( 'Blur.', editor );
                            } }
                            onFocus={ ( event, editor ) => {
                                console.log( 'Focus.', editor );
                            } }
                            style={{height: "300px"}}
                            id="content"
                        />
                </form>
            </div>
        </div>
    )
}

export default Admin
